var createCanvasContext, gameReady, handleComplete, handleFileLoad, init;

init = function() {
  var images, loader;

  // resize marquee to height=200px;
  $("#sugarad-728x90", window.top.document).css('height', '250px');

  createjs.MotionGuidePlugin.install();
  window.canvas = createCanvasContext(970, 600);
  images = images || {};
  loader = new createjs.LoadQueue(false);
  loader.addEventListener("fileload", handleFileLoad);
  loader.addEventListener("complete", handleComplete);
  return loader.loadManifest(lib.properties.manifest);
};

gameReady = function() {
  window.GoliGame.expand = function() {
    window.GoliGame.reset();
    $("#sugarad-728x90", window.top.document).animate({
      height: 600
    }, 600);
    $("#gameFrame", window.top.document).animate({
      height: 600
    }, 1000);
  };
  window.GoliGame.kickBall = function(angle, speed) {
    var success, type;
    success = false;
    if (angle < -60) {
      type = 0;
    } else if (angle > 60) {
      type = 7;
    } else if (speed < 0.1) {
      type = Math.floor(Math.random() * 1.99) * 7;
    } else {
      type = 1 + Math.floor((angle + 59.99) / 20);
      success = Math.random() < (0.25 + Math.random() * 0.75 * speed);
    }
    console.log(angle, type, success);
    window.GoliGame.kick(type, success);
  };
  window.top.GoliGame = window.GoliGame;
};

createCanvasContext = function(width, height) {
  var canvas;
  canvas = document.createElement("canvas");
  canvas.id = "game";
  canvas.height = height;
  canvas.width = width;
  document.body.appendChild(canvas);
  return canvas;
};

handleFileLoad = function(evt) {
  if (evt.item.type === "image") {
    images[evt.item.id] = evt.result;
  }
};

handleComplete = function() {
  var exportRoot, stage;
  exportRoot = new lib.GoliGame();
  stage = new createjs.Stage(canvas);
  stage.addChild(exportRoot);
  stage.update();
  createjs.Ticker.setFPS(lib.properties.fps);
  createjs.Ticker.addEventListener("tick", stage);
  gameReady();
};
